benchmarkTest "interleaveData() not touching ec codewords":
  var qr1 = encodeOnly newQRCode("Hello, world!", version = 3, ecLevel = qrECQ)
  qr1.interleaveData

  check qr1.data[34..69] == @[135'u8,92,231,244,155,101,127,60,162,188,37,72,136,36,55,77,65,44,105,32,214,166,21,0,169,197,123,43,92,124,82,170,23,172,216,71]

